// Create About component here to display the a small content here.
// In this component use paragraph tag (p) to display the content

import React, {Component} from "react";
class About extends Component{
    render(){
        return(
            <div className="about">
                <p>Hi, my name is Pranav. I am a full stack web
                developer and I have developed serveral projects
                with MERN stack. I am also familiar with Python
                and Django.
                </p>
            </div>
        );
    }
}
export default About;
